    LangID(int value) {
        _value = value;
    }

    private final int _value;

    /**
     * Returns the language ID enum for the provided integer return value
     */
    public static LangID of(int value) {
        if (value < 0 || value >= LANGUAGES.length)
            throw new NoSuchElementException("No language with ID " + value);
        return LANGUAGES[value];
    }

    private static final LangID[] LANGUAGES;

    static {
        int maxValue = -1;
        for (LangID l : values())
            maxValue = Math.max(maxValue, l._value);
        LANGUAGES = new LangID[maxValue + 1];
        EnumSet.allOf(LangID.class).forEach((e) -> LANGUAGES[e._value] = e);
    }
